import React from "react";
import EosFooterLogo from "../Assets/";

function Footer() {
  return (
    <div className="footer-div">
      <div className="footer-inner-div">
        <img className="footer-logo" scr={EosFooterLogo} alt="Company Logo" />
      </div>
    </div>
  );
}

export default Footer;
